import React from 'react';
import PropTypes from 'prop-types';

const Header = props => (
  <header>
    <h1>
      Catch
      <span className ="ofThe">
        <span className ="of">Of</span>
        <span className ="the">The</span>
      </span>
      Day
    </h1>
    <h3 className = "tagline">
      <span>{props.tagline}</span>
    </h3>
  </header>
);

export default Header;
